def calculate_hilbert_coordinates(a: int, b: int) -> tuple[int, int]:
    """"""

    def rotate(x: int, y: int, sx: int, sy: int, n: int) -> tuple[int, int]:
        if sy == 0:
            if sx == 1:
                (x, y) = (n - 1 - x, n - 1 - y)
            (x, y) = (y, x)
        return (x, y)
    (x, y) = (0, 0)
    for i in range(a):
        sect = 2 ** i
        sx = b >> 1 & 1
        sy = (b ^ sx) & 1
        (x, y) = rotate(x, y, sx, sy, sect)
        x += sect * sx
        y += sect * sy
        b //= 4
    return (x, y)
